<script>
import { wxShare } from "@/static/js/wxshare.js";
import Clipboard from "clipboard";
import soshm from "soshm";
import { Toast } from "mint-ui";
export default {
  components: {
    Toast: Toast
  },
  data() {
    return {
      useMessage: this.$store.state.useMessage,
      liulangqi: localStorage.getItem("liulangqi"),
      phone: "",
      isPhone: false,
      userData: "",
      share: false,
      qqliulangqi: localStorage.getItem("qq"),
      ucqq: true,
      loginCode: "",
      timeNum: "获取验证码",
      currentTime: 61,
      disabled: false,
      code: "",
      orderNum: 0,
      orderid: this.$route.query.orderid,
      orderDetail: null,
      showtip: true
    };
  },
  computed: {
    uid() {
      return this.$store.state.useMessage.mem_id || "";
    }
  },
  methods: {
    reAboutUs() {
      this.$router.push({
        name: "aboutUs"
      });
    },
    reHome() {
      this.$router.push({
        name: "home"
      });
    },
    copyText() {
      var that = this;
      if (Clipboard.isSupported()) {
        var clipboardDemos = new Clipboard(
          "[data-clipboard-demo]"
        ); /*创建方法*/
        /*复制成功回调*/
        clipboardDemos.on("success", function(e) {
          e.clearSelection();
          Toast({
            message: "复制成功",
            position: "bottom",
            duration: 2000
          });
          clipboardDemos.destroy();
        });
        /*复制失败回调*/
        clipboardDemos.on("error", function(err) {
          clipboardDemos.destroy();
        });
      } else {
        /*浏览器不支持时，进入手动复制方法*/
        Toast({
          message: "您的浏览器暂不支持此功能！请手动复制",
          position: "bottom",
          duration: 2000
        });
      }
    },
    cancel() {
      console.log(111);
      this.showtip = false;
    },
    reTiao() {
      if (this.orderDetail.ord_type_name == "大师服务") {
        this.$router.push({
          name: "masterList",
          query: {
            id: this.orderDetail.cate_id,
            name: this.orderDetail.cate_name
          }
        });
      } else if (this.orderDetail.ord_type_name == "快速提问") {
        this.$router.push({
          name: "quickquestion"
        });
      } else if (this.orderDetail.ord_type_name == "话题快测") {
        this.$router.push({
          name: "topic"
        });
      } else {
        this.$router.push({
          name: "shortcutphone"
        });
      }
    },
    doshare() {
      if (this.liulangqi == 2 && this.qqliulangqi == 0) {
        this.share = true;
        return;
      }

      Toast({
        message: "请点击右上角分享",
        position: "bottom",
        duration: 2000
      });
    },
    qushare() {
      this.share = false;
    },
    phoneLogin() {
      var ag_id = 0;
      if (localStorage.getItem("ag_id")) {
        ag_id = localStorage.getItem("ag_id");
      }
      if (!this.phone) {
        Toast({
          message: "请输入手机号码",
          position: "bottom",
          duration: 2000
        });
        return;
      }
      if (!this.code) {
        Toast({
          message: "请输入验证码",
          position: "bottom",
          duration: 2000
        });

        return;
      }
      if (this.code != this.loginCode) {
        Toast({
          message: "验证码输入错误",
          position: "bottom",
          duration: 2000
        });
        return;
      }
      this.$http
        .post("bind_member", {
          phone: this.phone,
          third_id: this.userData.third_id,
          ag_id: ag_id
        })
        .then(res => {
          if (res.data.code == 200) {
            this.isPhone = false;
            var useMessage = res.data.data;
            this.useMessage = res.data.data;

            localStorage.getItem("useMessage", JSON.stringify(useMessage));
            this.$store.commit("upState", useMessage);
          }
        });
    },
    rePersonSet() {
      this.$router.push({ name: "personSet" });
    },
    weiXingLogin() {
      if (this.liulangqi == 2) {
        this.$router.push({ name: "login" });
      } else {
        this.weixinLogin();
      }
    },
    webLogin() {
      this.$router.push({ name: "login" });
    },

    weixinLogin() {
      var gid = this.$route.query.gid || 1;
      var url = encodeURIComponent(window.location.href);
      var a = window.location.href;
      if (a.indexOf("code") != -1) {
        var num = a.indexOf("code") - 1;
        var cc = a.substring(a.indexOf("code"));
        var reg = new RegExp("(^|&)" + "code" + "=([^&]*)(&|$)", "i");
        var r = JSON.stringify(cc)
          .substr(1)
          .match(reg);
        var ggg = unescape(r[2]);
        this.$http
          .post("wechat_login", {
            code: ggg
          })
          .then(res => {
            if (res.data.code == 10002) {
            this.isPhone = true;
            } else if (res.data.code == 200) {
              var useMessage = res.data.data;
              this.useMessage = res.data.data;
              localStorage.getItem("useMessage", JSON.stringify(useMessage));
              this.$store.commit("upState", useMessage);
            }
          });
      } else {
        window.location.href =
          "https://open.weixin.qq.com/connect/oauth2/authorize?appid=wx77be7b1c86a6a375&redirect_uri=" +
          url +
          "&response_type=code&scope=snsapi_userinfo&state=" +
          gid +
          "#wechat_redirect";
      }
    },

    getCode() {
      if (this.phone) {
        var interval = setInterval(() => {
          this.currentTime--;
          this.disabled = true;
          this.timeNum = this.currentTime + "秒重新获取";
          if (this.currentTime <= 0) {
            clearInterval(interval);
            this.timeNum = "重新获取";
            this.currentTime = 61;
            this.disabled = false;
          }
        }, 1000);
        this.$http.post("alisms_send", { tel: this.phone }).then(res => {
          if (res.data.ResultCode == 400) {
            Toast({
              message: "同个号码使用次数过多",
              position: "bottom",
              duration: 2000
            });
          } else {
            this.loginCode = res.data.data;
          }
        });
      } else {
        Toast({
          message: "请输入手机号码",
          position: "bottom",
          duration: 2000
        });
      }
    }
  },
  created() {
    if (this.liulangqi == 1) {
      var a = window.location.href;
      if (a.indexOf("code") != -1) {
        var num = a.indexOf("code") - 1;
        var cc = a.substring(a.indexOf("code"));
        var reg = new RegExp("(^|&)" + "code" + "=([^&]*)(&|$)", "i");
        var r = JSON.stringify(cc)
          .substr(1)
          .match(reg);
        var ggg = unescape(r[2]);
        this.$http
          .post("wechat_login", {
            code: ggg
          })
          .then(res => {
            if (res.data.code == 10002) {
              this.isPhone = true;
              this.userData = res.data.data;
            } else if (res.data.code == 200) {
              this.useMessage = res.data.data;
              var useMessage = res.data.data;
              localStorage.getItem("useMessage", JSON.stringify(useMessage));
              this.$store.commit("upState", useMessage);
            }
          });
      }
    }

    var shareWxLink =
      window.location.href.split("#")[0] +
      "static/redirect.html?app3Redirect=" +
      encodeURIComponent(window.location.href);
    wxShare(
      {
        title: "个人中心", // 分享标题
        desc:
          "问易台是中国领先的易学文化服务平台，荟聚国内易学精英，致力为易学爱好着提供交流、分享、学习的资源交流平台。问易台作为一个高端易学文化平台，用户可随时向专家提问，寻求答案，专家立即回复，为用户快速解决问题。", // 分享描述
        link: shareWxLink, // 分享链接
        imgUrl:
          "http://cdn.ywhwl.com/images/2/2018/09/EkyIIryKcecKi2ecnCc7r8rEARKr72.jpg", // 分享图标
        debug: false
      },
      function() {}
    );

    if (this.$store.state.useMessage.mem_id) {
      this.$http
        .post("no_order_num", {
          mem_id: this.$store.state.useMessage.mem_id,
          token: this.$store.state.useMessage.token
        })
        .then(res => {
          console.log(res);
          if (res.data.code == 200) {
            this.orderNum = res.data.data;
          }
        });

      this.$http
        .post("order_detail", {
          ord_id: this.orderid,
          token: this.$store.state.useMessage.token
        })
        .then(res => {
          if (res.data.code == 200) {
            this.orderDetail = res.data.data["0"];
          }
        });
    }
  },
  mounted() {
    var setShare = [];
    if (
      navigator.userAgent.indexOf("UCBrowser") > -1 ||
      (navigator.userAgent.toLowerCase().indexOf("mqqbrowser") > -1 &&
        navigator.userAgent.toLowerCase().indexOf(" qq") < 0)
    ) {
      setShare = ["weixin", "weixintimeline", "weibo", "qq", "qzone"];
    } else {
      setShare = ["weibo", "qq", "qzone"];
      this.ucqq = false;
    }
    soshm("#share", {
      url: window.location.href,

      title: "问易台",

      digest: "问易台是个有温度的平台",

      pic: "",

      sites: setShare
    });

    console.log(this.$store.state.useMessage);
  }
};
</script>